 receptor-mediated regulation of mitogen-activated protein kinase phosphorylation in rat brain . Mitogen-activated protein kinases ( MAPKs ) , a family of signal transduction mediators important in a host of cellular activities , include the extracellular signal-regulated kinases Erk 1 and Erk 2 . We determined whether 5 - HT ( 1A ) receptors activate Erk 1/2 in rat brain in vivo , as they do in recombinant cell lines . In contrast to the effect in cells , the 5 - HT ( 1A ) receptor agonist 8 - hydroxy-N , N-diproylaminotetralin ( 8 - OH-DPAT ) dose - and time-dependently decreased basal levels of phosphorylated Erk 1/2 ( phospho-Erk 1/2 ) in rat hippocampus ( ED ( 50 ) approximately 0.1 mg / kg , maximum approximately 90 % ) without altering total Erk 1/2 . The effects were kinase-specific , as 8 - OH-DPAT did not modify phosphorylated or total levels of the MAPKs c-Jun-N-terminal kinase / stress-activated protein kinase ( JNK / SAPK ) and p38 MAPK . Moreover , 8 - OH-DPAT did not modify phospho-Erk 1/2 in striatum or frontal cortex . The effect of 8 - OH-DPAT was blocked by pretreatment with the selective 5 - HT ( 1A ) receptor antagonists N - [ 2 - [ 4 - ( 2 - methoxyphenyl ) - 1 - piperazinyl ] ethyl ] - N - 2 - pyridinylcyclohexanecarboxamide ( WAY 100635 ) , 1 - ( 2 - methoxyphenyl ) - 4 - ( 4 - [ 2 - phthalimido ] butyl ) piperazine ( NAN - 190 ) and 4 - fluoro-N - ( 2 - [ 4 - ( 2 - methoxyphenyl ) 1 - piperazinyl ] ethyl ) - N - ( 2 - pyridinyl ) benzamide dihydrochloride ( p-MPPF ) , but not by the weak partial agonist / antagonist 8-( 2 - [ 4 - ( 2 - methoxyphenyl ) - 1 - piperazinyl ] ethyl )-8 - azaspiro ( 4.5 ) decane -7,9- dione dihydrochloride ( BMY 7378 ) . Other 5 - HT ( 1A ) receptor agonists ( buspirone , gepirone and ipsapirone ) also reduced phospho-Erk 1/2 levels in hippocampus . 8 - OH-DPAT also reduced the levels of the upstream activator of Erk 1/2 , phosphorylated extracellular signal-regulated kinase kinase ( phospho -

<div class="entities" style="line-height: 2.5; direction: ltr">Tumor-derived exosomes promote tumor progression and T-cell dysfunction through the regulation of enriched exosomal microRNAs in human nasopharyngeal carcinoma . Tumor-derived exosomes contain biologically active proteins and messenger and microRNAs ( miRNAs ) . These particles serve as vehicles of intercellular communication and are emerging mediators of tumorigenesis and immune escape . Here , we isolated 30-100 nm exosomes from the serum of patients with nasopharyngeal carcinoma ( NPC ) or the supernatant of TW03 cells . Increased circulating exosome concentrations were correlated with advanced lymphoid node stage and poor prognosis in NPC patients ( P &lt; 0.05 ) . TW03 - derived exosomes impaired T-cell function by inhibiting T-cell proliferation and Th1 and Th17 differentiation and promoting Treg induction by NPC cells in vitro . These results are associated with decreases in

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) inhibitor , captopril , in addition to previous antihypertensive treatment with one or more drugs . Blood pressure control tended to improve on captopril ( systolic pressures 152 + / - 13 vs 140 + / - 13 mm Hg , P &lt; 0.05 ; diastolic pressures 89 + / - 10 vs 87 + / - 10 mm Hg , not significant ) . Proteinuria ( &gt; 0.5 g / 24 hours ) fell into the microalbuminuria range ( albumin excretion 2-20 mg / mmol creatinine ) in four out of 13 patients , and microalbuminuria disappeared in four out of ten patients . Urinary levels of the brush border enzyme O60502 ( NAG ) , a marker of tubular dysfunction , were initially raised and fell significantly after 8 months ' treatment with captopril ( 20.3 + / - 14.4 vs 8.8 + / - 8.1 U / g creatinine ; P &lt; 0.01 ) .

<div class="entities" style="line-height: 2.5; direction: ltr">Menadione reduction by pharmacological doses of ascorbate induces an oxidative stress that kills breast cancer cells . Oxidative stress generated by ascorbate-driven menadione redox cycling kills MCF 7 cells by a concerted mechanism including glycolysis inhibition , loss of calcium homeostasis , DNA damage and changes in mitogen activated protein kinases ( MAPK ) activities . Cell death is mediated by necrosis rather than apoptosis or macroautophagy . Neither 3 - methyladenine nor Z-VAD affects cytotoxicity by ascorbate / menadione ( Asc / Men ) . BAPTA-AM , by restoring cellular capacity to reduce MTT , underlines the role of calcium in the necrotic process . Oxidative stress-mediated cell death is shown by the opposite effects of DB06151 and 3 - aminotriazole . Moreover , oxidative stress induces DNA damage ( protein poly-ADP-ribosylation and gamma -

<h2 style="margin: 0">23</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Role of endothelin - 1 receptor blockers on hemodynamic parameters and oxidative stress . Endothelin ( ET ) was first isolated and described by Yanagisawa et al . and has since been described as one of the most potent known vasoconstrictor compounds . ET - 1 mediates its effects via two types of receptors , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25101
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and ETB , which are expressed in the vascular smooth muscle cells , endothelial cells , intestines and brain . Secretion of ET - 1 results in long-lasting vasoconstriction , increased blood pressure and , in turn , overproduction of free radicals . As dysregulation of the endothelin system is an important factor in the pathogenesis of several diseases including atherosclerosis , hypertension and endotoxic shock , the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25101
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and ETB receptors are attractive therapeutic targets for treatment of these disorders . The biosynthesis and release of ET - 1 are regulated at the transcriptional level . Studies have shown that p38MAP kinase , nuclear factor kappaB ( NF-kappaB ) , PKC / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29323
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and JNK / c-Jun all take part in the ROS-activated production of ET - 1 . Furthermore , administration of ET ( A ) significantly reduces the generation of free radicals . However , treatment with ETB receptor blockers does not elicit the same effect . Therefore , the effects of endothelin receptor blockers on blood pressure and the generation of free radicals remain debatable . This review summarizes recent investigations into the role of endothelin receptor blockers with respect to the modulation of hemodynamic parameters and the generation of free radicals .</div>

 is an oral

<div class="entities" style="line-height: 2.5; direction: ltr">Managing the underlying cause of cystic fibrosis : a future role for potentiators and correctors . Cystic fibrosis ( CF ) , a severe genetic disease , is caused by mutations that alter the structure and function of

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 function in multiple ways . In particular , class 3 mutations such as p . Gly 551Asp strongly decrease the time spent by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in the open state ( gating defect ) . Instead , class 2 mutations impair the maturation of

 protein and its transport from the endoplasmic reticulum to the plasma membrane ( trafficking defect ) . The deletion of phenylalanine 508 ( p . Phe 508del ) , the most frequent mutation among CF patients ( 70-90 % ) , destabilizes the

 or VX - 770 ) , developed by Vertex Pharmaceuticals , has been recently approved by the US FDA and the European Medicines Agency (

 ) for the treatment of CF patients carrying at least one

 allele with the p . Gly 551Asp mutation ( 2-5 % of all patients ) . In contrast , the corrector VX - 809 , which significantly improves p . Phe 508del -

 trafficking in vitro , is still under study in clinical trials . Because of multiple defects caused by the p . Phe 508del mutation , it is probable that rescue of the mutant protein will require combined treatment with correctors having different mechanisms of action . This review evaluates the status of experimental and clinical research in pharmacotherapy for the CF basic defect .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Blood flow alterations in TNBS-induced colitis : role of endothelin receptors . OBJECTIVES : The aim of the present study was to investigate the time dependent changes in hemodynamic parameters and to assess the role of endothelin ( ET ) receptors in trinitrobenzene sulfonic acid ( TNBS ) induced colitis . MATERIALS : Inferior mesenteric artery ( IMA ) hemodynamics , myeloperoxidase activity (
